import React, { useRef } from 'react';
import { useNavigate } from 'react-router-dom';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import 'swiper/css/navigation';
import { Navigation, Autoplay } from 'swiper/modules';

const services = [
  { icon: '✈️', title: 'Airport Pickup' },
  { icon: '🏠', title: 'Housing Help' },
  { icon: '💼', title: 'Job Board' },
  { icon: '📚', title: 'Student Support' },
  { icon: '🆔', title: 'SIN & ID Setup' },
  { icon: '🛍️', title: 'Nepali Stores' },
  { icon: '📄', title: 'Legal Help' },
  { icon: '🗣️', title: 'Language Prep' },
  { icon: '🤝', title: 'Community' },
  { icon: '👨‍⚕️', title: 'Health Services' },
  { icon: '🧘‍♂️', title: 'Mental Wellness' },
  { icon: '📦', title: 'Courier & Cargo' },
  { icon: '🏦', title: 'Banking Advice' },
  { icon: '🍼', title: 'Childcare Info' },
  { icon: '🎓', title: 'Scholarship Guide' },
  { icon: '📅', title: 'Events Calendar' },
  { icon: '🧑‍🏫', title: 'Skill Training' },
  { icon: '📞', title: 'Emergency Contacts' },
  { icon: '🧾', title: 'Tax Filing Help' },
  { icon: '🎮', title: 'Youth Programs' },
  { icon: '🧑‍🍳', title: 'Cooking Classes' },
  { icon: '🛒', title: 'Grocery List' },
  { icon: '🚗', title: 'Driving License' },
  { icon: '📬', title: 'Postal & Shipping' },
  { icon: '🕌', title: 'Religious Centers' },
  { icon: '🏕️', title: 'Travel & Outdoors' },
  { icon: '🧼', title: 'Household Setup' },
  { icon: '💻', title: 'Digital Literacy' }
];

export default function Dashboard() {
  const navigate = useNavigate();
  const scrollRef = useRef(null);

  const scroll = (direction) => {
    if (scrollRef.current) {
      scrollRef.current.scrollBy({ left: direction === 'left' ? -300 : 300, behavior: 'smooth' });
    }
  };

  return (
    <div className="bg-gray-50 min-h-screen font-sans">
      <div className="bg-white shadow p-4 flex justify-between items-center sticky top-0 z-10">
        <h1 className="text-2xl font-bold text-blue-700">ConnectingNepali</h1>
        <button
          onClick={() => {
            localStorage.clear();
            navigate('/');
          }}
          className="bg-red-500 text-white px-4 py-2 rounded hover:bg-red-600"
        >
          Logout
        </button>
      </div>

      <div className="bg-blue-100 py-10 px-6">
        <div className="max-w-7xl mx-auto text-center">
          <h2 className="text-3xl font-bold text-gray-800 mb-2">Welcome, Nepali Immigrants!</h2>
          <p className="text-gray-700 text-lg">Explore essential services, support, and opportunities across Canada.</p>
        </div>
      </div>

      <div className="bg-white py-10 px-6">
        <div className="max-w-7xl mx-auto flex flex-col md:flex-row items-center justify-between gap-10 p-6 rounded-2xl shadow-md border border-gray-200 bg-gradient-to-br from-blue-50 to-white">
          <div className="md:w-1/2">
            <h2 className="text-3xl font-bold text-gray-800 mb-3">Announcements & Events</h2>
            <p className="text-gray-600 mb-4">Stay updated with helpful events, news, and updates curated for Nepali immigrants in Canada.</p>
            <button className="bg-blue-600 text-white px-6 py-2 rounded hover:bg-blue-700 transition">Browse now</button>
          </div>
          <div className="md:w-1/2">
            <Swiper
              spaceBetween={20}
              slidesPerView={1}
              autoplay={{ delay: 3000 }}
              navigation
              loop
              modules={[Navigation, Autoplay]}
            >
              {['shoe1.png', 'shoe2.png', 'shoe3.png'].map((img, index) => (
                <SwiperSlide key={index}>
                  <div className="rounded-xl overflow-hidden shadow-md bg-white p-4">
                    <img src={`/images/${img}`} alt={`Event ${index + 1}`} className="w-full h-48 object-contain" />
                  </div>
                </SwiperSlide>
              ))}
            </Swiper>
          </div>
        </div>
      </div>

      <div className="px-6 py-10 bg-white relative">
        <h2 className="text-2xl font-bold text-gray-800 mb-6">Our Services</h2>
        <button
          onClick={() => scroll('left')}
          aria-label="Scroll Left"
          className="absolute left-2 top-1/2 transform -translate-y-1/2 bg-white border p-2 rounded-full shadow hover:bg-blue-100 z-10"
        >
          ◀
        </button>

        <div
          ref={scrollRef}
          className="flex space-x-6 overflow-x-auto no-scrollbar pb-4 px-6 before-after-fade items-start"
        >
          {services.map((item, i) => (
            <div
              key={i}
              className="flex-shrink-0 w-36 bg-blue-50 border border-blue-200 rounded-xl shadow-md p-4 text-center hover:scale-105 transition-transform duration-200"
              title={item.title}
            >
              <div className="text-4xl mb-2 text-blue-600">{item.icon}</div>
              <h4 className="text-sm font-semibold text-blue-700 leading-tight">{item.title}</h4>
            </div>
          ))}
        </div>

        <button
          onClick={() => scroll('right')}
          aria-label="Scroll Right"
          className="absolute right-2 top-1/2 transform -translate-y-1/2 bg-white border p-2 rounded-full shadow hover:bg-blue-100 z-10"
        >
          ▶
        </button>
      </div>
    </div>
  );
}
